const styles = (theme) => ({
    root : {

    }
})

const Order = ({}) => {
    return (<Box>
        <Container>
            <Grid container>

            </Grid>
        </Container>
    </Box>)
}

Order.propTypes = {
    // eslint-disable-next-line react/forb,id-prop-types
    classes: PropTypes.object.isRequired,
}

export default withStyles(styles)(Order)
